impl Solution {
    pub fn count_complete_subarrays(nums: Vec<i32>) -> i32 {
        use std::collections::HashMap;

        let mut count = 0;
        let total_distinct = nums.iter().collect::<std::collections::HashSet<_>>().len();
        let mut freq_map = HashMap::new();
        let mut j = 0;
        for i in 0..nums.len() {
            while j < nums.len() && freq_map.len() < total_distinct {
                *freq_map.entry(nums[j]).or_insert(0) += 1;
                j += 1;
            }
            if freq_map.len() == total_distinct {
                count += (nums.len() - j + 1) as i32;
            }
            *freq_map.get_mut(&nums[i]).unwrap() -= 1;
            if freq_map[&nums[i]] == 0 {
                freq_map.remove(&nums[i]);
            }
        }
        count
    }
}
